import { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { useNavigate } from 'react-router';
import { getCollectionNameByContract } from '../../redux/collection/collection.utils';

import SearchBox from '../../components/search-box/search-box.component';
import CollectionPage from '../collection/collection.component';

import CustomButton from '../../components/custom-buttons/custom-button.component';

import { HomePageContainer } from './home-page.styles';
import {selectCollections} from '../../redux/collection/collection.selectors';

const HomePage = () => {
	const [searchField, setSearchField] = useState('');
	const collections = useSelector(selectCollections)
	const [collectionName, setCollectionName] = useState('');
	const navigate = useNavigate();

	const onSearchChange = (event) => {
		const searchFieldString = event.target.value.toLocaleLowerCase();
		setSearchField(searchFieldString);
	};

	useEffect(() => {
    const name = getCollectionNameByContract(collections, searchField); 

    setCollectionName(name);
  }, [searchField]);

	console.log(getCollectionNameByContract(collections, '0xbc4ca0eda7647a8ab7c2061c2e118a18a936f13d'));
	console.log(collectionName);
	return (
		<HomePageContainer>
			<SearchBox
				className='monsters-search-box'
				onChangeHandler={onSearchChange}
				placeholder='search contract'
			/>
			<CustomButton onClick={() => navigate(`/collections/searchField`)} > search </CustomButton>
		</HomePageContainer>
	);
};

export default HomePage;
